import React from 'react';
import './Styles/Menu.css';

const Menu = (props)=>{

    return ( 
        <div className='menuback'>
            <ul>
            <li>Set-Profile</li>
            <li>Global Chat</li>
            <li>All Posts</li>
            <li>Your Posts</li>
            <li>Sign-Out</li>
            </ul>
        </div>
    )
}

export default Menu;
